  01> LUDBROOK, Geraldine Ann and (2)CHINELLATO, Stefano
  b 09.12.1958
  b 22.12.1954
  Geraldine is known by her maiden name. Address: Castello 476, Venezia 30122, Italy.
  Geraldine was educated at Norwood High School and the University of Adelaide (BA). She is a
  foreign language tutor at the University of Venice and editorial assistant to the journal,
  "Research in Economics" published by Academic Press, London.
  01> CHINELLATO, Samuele Ludbrook
  b 22.08.1995
