  02> LUDBROOK, Guy Lawrence m on 14.04.1993 to (2)GIBBS, Diana Margaret
  b 23.01.1960
  b 18.09.1961
  Address: 6 Howard Terrace, Leabrook 5068, SA, Australia.
  Guy was educated at Norwood High School and University of Adelaide (MB, BS, PhD, FANZCA). He was
  Registrar then Senior Registrar in Anaesthesia (1987-). He is now Lecturer, Department of
  Anaesthesia and Intensive Care, University of Adelaide; Consultant Anaesthesiologist and Deputy
  Director of Clinical Anaesthesia, Royal Adelaide Hospital.
